public static Tag valueOf(String tagName) {
Validate.notNull(tagName);
tagName = tagName.trim().toLowerCase();
Validate.notEmpty(tagName);
synchronized (tags) {
Tag tag = tags.get(tagName);
if (tag == null) {
tag = new Tag(tagName);
tag.setAncestor(defaultAncestor.tagName);
tag.isBlock = false;
tag.canContainBlock = true;
return tag;
}

public boolean matches(String seq) {
int len = seq.length();
if (len > queue.size())
return false;
List<Character> chars = queue.subList(0, len);
char[] seqChars = seq.toCharArray();
for (int i = 0; i < len; i++) {
Character found = Character.toLowerCase(chars.get(i));
Character check = Character.toLowerCase(seqChars[i]);
if (!found.equals(check))
return false;
return true;
}

protected void setParentNode(Node parentNode) {
if (this.parentNode != null)
this.parentNode = parentNode;
}

public String html() {
StringBuilder accum = new StringBuilder();
html(accum);
return accum.toString().trim();
